import { blue } from "@mui/material/colors";
import { fontSize } from "@mui/system";
import { useState, useEffect } from "react";
import Navbar from "../templates/Navbar";
import Vendor_Navbar from "../templates/Vendor_Navbar";
import { useLocation } from "react-router";
import React from 'react';

const Vendor_Home = (props) => 
    {
        const navigate = useNavigate();

        let location = useLocation();
        const [username, setUser] = useState("");
        const [contactNumber, setc] = useState("");
        const [age, setAge] = useState("");
        const [batch, setBatch] = useState("");

        const [email, setEmail] = useState(localStorage.getItem("email"));
        const [type, setType] = useState(localStorage.getItem("type"));

        const Nuser = {
          email: email,

        }
        useEffect(() => {

          if (type !== "buyer") {

            alert("You do not have permission to access this page");
            navigate("/")
          }
          axios
            .post('http://localhost:4000/user/xxx', Nuser)
            .then((response) => {
              console.log(response.data);
              if (response.data.val == 1) {
                console.log(response.data);
                setUser(response.data.name);
                setAge(response.data.age);
                setc(response.data.contactNumber);
                setBatch(response.data.batch);
                console.log(response.data);
                console.log("here");

              }
              else {
                alert("no fetch");
              }
            })
            .catch((error) => {
              console.log(error);
            }
            );          // setc(response.contactNumber)
        }, [])

    return <div>
        <Vendor_Navbar />
        <div><h1><center>Welcome to vendor page Mr/Mrs {location.state} </center></h1></div>
    </div>;
}

export default Vendor_Home;
